DROP TABLE IF EXISTS `players`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `players` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `nickname` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ingame name of player',
  `country_id` smallint unsigned NOT NULL COMMENT 'origin of player',
  `current_team_id` int unsigned DEFAULT NULL COMMENT 'id of the team which player belongs to',
  `current_discipline_id` smallint unsigned NOT NULL COMMENT 'discipline of which is the team or single player',
  `is_active` tinyint(1) DEFAULT NULL COMMENT 'is the player active now',
  `team_function_id` tinyint unsigned NOT NULL COMMENT 'the role of player in the team',
  `add_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `player_country_id_fk` (`country_id`),
  KEY `player_current_team_id_fk` (`current_team_id`),
  KEY `player_current_discipline_id_fk` (`current_discipline_id`),
  KEY `player_team_function_id_fk` (`team_function_id`),
  KEY `players_nickname_idx` (`nickname`),
  CONSTRAINT `player_country_id_fk` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `player_current_discipline_id_fk` FOREIGN KEY (`current_discipline_id`) REFERENCES `disciplines` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `player_current_team_id_fk` FOREIGN KEY (`current_team_id`) REFERENCES `teams` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `player_team_function_id_fk` FOREIGN KEY (`team_function_id`) REFERENCES `team_functions` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
