--
-- Table structure for table `tournament_profiles`
--

DROP TABLE IF EXISTS `tournament_profiles`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tournament_profiles` (
  `tournament_id` int unsigned NOT NULL,
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'name of tournament',
  `tournament_operator_id` smallint unsigned DEFAULT NULL COMMENT 'an id of organization which is provide tournament',
  `location` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'place of holding of tournament',
  `cast_studio_id` smallint unsigned DEFAULT NULL COMMENT 'broadcaster of tournament',
  `discipline_id` smallint unsigned NOT NULL COMMENT 'name of tournaments',
  `media_id` int unsigned NOT NULL COMMENT 'a logo of tournament',
  `country_id` smallint unsigned NOT NULL COMMENT 'a country of tournament placement',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  KEY `tournament_profiles_tournament_id_fk` (`tournament_id`),
  KEY `tournament_profiles_tournament_operators_id_fk` (`tournament_operator_id`),
  KEY `tournament_profiles_cast_studio_id_fk` (`cast_studio_id`),
  KEY `tournament_profiles_discipline_id_fk` (`discipline_id`),
  KEY `tournament_profiles_media_id_fk` (`media_id`),
  KEY `tournament_profiles_country_id_fk` (`country_id`),
  KEY `tournament_profiles_name_idx` (`name`),
  CONSTRAINT `tournament_profiles_cast_studio_id_fk` FOREIGN KEY (`cast_studio_id`) REFERENCES `cast_studios` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `tournament_profiles_country_id_fk` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `tournament_profiles_discipline_id_fk` FOREIGN KEY (`discipline_id`) REFERENCES `disciplines` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `tournament_profiles_media_id_fk` FOREIGN KEY (`media_id`) REFERENCES `media` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `tournament_profiles_tournament_id_fk` FOREIGN KEY (`tournament_id`) REFERENCES `tournaments` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tournament_profiles_tournament_operators_id_fk` FOREIGN KEY (`tournament_operator_id`) REFERENCES `tournament_operators` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

