--
-- Table structure for table `tournaments`
--

DROP TABLE IF EXISTS `tournaments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tournaments` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `discipline_id` smallint unsigned NOT NULL COMMENT 'name of tournaments',
  `active_status_id` tinyint unsigned NOT NULL COMMENT 'status of tournament upcoming, ongoing, recent',
  `begins_at` date NOT NULL COMMENT 'date of start of tournament',
  `ends_at` date DEFAULT NULL COMMENT 'date of finish of tournament ',
  `prize` int unsigned DEFAULT NULL COMMENT 'prize pool',
  `participants_num` smallint unsigned DEFAULT NULL COMMENT 'number of participants',
  `location` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'place of holding of tournament',
  `is_online` tinyint(1) DEFAULT NULL COMMENT 'is the tournament via net or an offline tournament in a particular place',
  `winner_team_id` int unsigned DEFAULT NULL,
  `add_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `tournaments_discipline_id_fk` (`discipline_id`),
  KEY `tournaments_active_status_id_fk` (`active_status_id`),
  CONSTRAINT `tournaments_active_status_id_fk` FOREIGN KEY (`active_status_id`) REFERENCES `statuses` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `tournaments_discipline_id_fk` FOREIGN KEY (`discipline_id`) REFERENCES `disciplines` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

